import React,{useEffect}from "react";
import { useNavigate,useLocation} from "react-router-dom";

export default function Welcome() {
    const navigate = useNavigate();
    const location=useLocation();
    useEffect(()=>{
        if(localStorage.getItem('token')){
            navigate("/welcome");
        }
    },[])
    
  return (
    <div>Welcome</div>
  )
}
